package programdemo;

public class SwaptwoNumber {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a=5;
		int b=10;
		
		a=a+b;
		b=a-b;
		a=a-b;
		
		System.out.println("Swapping Number");
		System.out.println("value of a" +a);
		System.out.println("Value of b" +b);
		

	}

}
